import React from 'react';
import ReactDOM from 'react-dom/client';
import { GridFunction } from './components/hw2';
import { Bug } from './components/hw3';
import { fetchFinanceSnippet } from './components/hw4';
import MyMain from "./components/Main";
import Page from './components/Page';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import NasaClass from './components/hw1';
import { Homeworks } from './components/homework'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <BrowserRouter>
        <Routes>
            <Route path={"/"} element={<Page />}>
                <Route index element={<MyMain />}/>
                <Route path={"/homework/homework"} element={<Homeworks/>}/>
                <Route path={"/homework/1"} element={<NasaClass />}/>
                <Route path={"/homework/2"} element={<GridFunction />}/>
                <Route path={"/homework/3"} element={<Bug />}/>
                {/* <Route path={"/homework/4"} element={<fetchFinanceSnippet />}/> */}
            </Route>
        </Routes>
    </BrowserRouter>
);
